import React from 'react'

import classes from './Item.module.css'

const Item = (props) => {
  
  const deleteItem = () => {
    props.onDelete(props.id);
}

  return (
    <div className={classes.item} onClick={deleteItem}> 
      {/* <h2 className={classes.item__header}>{props.title}</h2> */}
      {/* <button onClick={deleteItem} >Delete This one</button> */}
    </div>
  )
}

export default Item;
